import { SET_USER_NAME, SET_TOKEN, SET_LAST_LOGIN} from "./actionTypes";

export const set_Username = (token) => {
  return { type: SET_USER_NAME, payload: token };
};

export const setToken = (token) => {
  return { type: SET_TOKEN, payload: token };
};

export const setLastLogin = (token) => {
  return { type: SET_LAST_LOGIN, payload: token };
};
